INSERT INTO `bosquetaoista_frase` VALUES (1,'La mejor victoria es vencer sin combatir','Si somos lo suficientemente inteligentes no deberemos combatir para salir airosos de un problema.'),(2,'Si utilizas al enemigo para derrotar al enemigo, serás poderoso en cualquier lugar a donde vayas','Saber enemistar a terceros nos puede hacer alcanzar la victoria sin mover ni un solo dedo.'),(3,'Llévalos a un punto del que no puedan salir, y morirán antes de poder escapar','En esta cita, Sun Tzu nos habla sobre la importancia de rodear a nuestros enemigos.'),(4,'Las armas son instrumentos fatales que solamente deben ser utilizadas cuando no hay otra alternativa','Para alcanzar la victoria no siempre será necesario el uso de la fuerza bruta.'),(5,'Cuando se está cerca, se debe parecer lejos, cuando se está lejos, se debe parecer cerca','Esta cita nos explica que debemos desorientar a nuestro enemigo para poder vencerlo.'),(6,'Un ejército victorioso gana primero y entabla la batalla después; un ejército derrotado lucha primero e intenta obtener la victoria después','La actitud con la que lleguemos a la batalla determinará en gran medida nuestro éxito.'),(7,'Si quieres fingir cobardía para conocer la estrategia de los adversarios, primero tienes que ser extremadamente valiente, porque sólo entonces puedes actuar como tímido de manera artificial','Fingir cobardía nos puede llevar hacia una muerte prematura, por ello se ha de ser muy valiente para utilizar esta táctica.'),(8,'Haz que los adversarios vean como extraordinario lo que es ordinario para ti; haz que vean como ordinario lo que es extraordinario para ti','Saber jugar nuestras bazas es algo sumamente importante en la táctica militar.'),(9,'Hay que comparar cuidadosamente el ejército opositor con el propio para saber dónde la fuerza es superabundante y dónde deficiente','Ver las flaquezas de nuestro adversario y poder ocultar las propias, nos permitirá alcanzar la victoria en el campo de batalla.'),(10,'Lo supremo en el arte de la guerra consiste en someter al enemigo sin darle batalla','Mucho antes de que se lance la primera flecha, la guerra ya habrá comenzado.'),(11,'La peor táctica es atacar a una ciudad','Esta cita nos habla sobre la ética en la guerra, las bajas civiles nunca son necesarias.'),(12,'Si tus fuerzas están en orden mientras que las suyas están inmersas en el caos, si tú y tus fuerzas están con ánimo y ellos desmoralizados, entonces, aunque sean más numerosos, puedes entrar en batalla','La estrategia y el ánimo son dos factores determinantes para poder vencer en una batalla, sin estos factores de nuestro lado es mucho más conveniente buscar la huida.'),(13,'Maniobrar con un ejército es ventajoso','Para poder dirigir un ejército en el campo de batalla, este debe haber sido disciplinado anteriormente.'),(14,'Los generales que conocen las variables posibles para aprovecharse del terreno sabe cómo manejar las fuerzas armadas','Las cualidades de un general son las que le llevaran o no a alcanzar la victoria, en un rango tan importante se ha de ser muy habilidoso.'),(15,'No presiones a un enemigo desesperado','Debemos permitir a nuestros enemigos un camino de huida, pues de esta forma se rendirán mucho antes.'),(16,'Para que perciban las ventajas de derrotar al enemigo, deben también obtener sus recompensas','Recompensar a nuestros soldados es algo vital para el buen funcionamiento de un ejército.'),(17,'Hacerte invencible significa conocerte a ti mismo','Cuando conocemos nuestras carencias sabemos cómo corregirlas y aprovecharlas a nuestro favor.'),(18,'Mantén a tus amigos cerca y a tus enemigos aún más cerca','Tener a nuestros amigos cerca nos permitirá conocerlos a fondo y poder detectar sus flaquezas.'),(19,'La invencibilidad es una cuestión de defensa, la vulnerabilidad es una cuestión de ataque','Si sabemos defendernos jamás seremos derrotados, pues un ataque prematuro nos debilita en gran medida.'),(20,'Incluso la mejor espada si se deja sumergida en agua salada finalmente se oxidará','Con el pasar de los años todos perdemos nuestras cualidades en lo que a la guerra se refiere.'),(21,'Cuando el enemigo esté relajado hazlo esforzarse','Saber sembrar el desconcierto en nuestro adversario le llevará inequívocamente hacia la derrota.'),(22,'Lo que los antiguos llamaban un luchador astuto es aquel que no sólo gana, sino que resalta por ganar con sencillez','Cuando ganamos de una forma rápida y sencilla, esa victoria adquiere mucho más valor pues es vista por nuestro adversarios como mucho más fulminante.'),(23,'Rápido como el viento, silencioso como el bosque, raudo y devastador como el fuego, inmóvil como una montaña','Sun Tzu nos habla en esta cita sobre las cualidades de cualquier buen ejército.'),(24,'La oportunidad de asegurarnos contra la derrota está en nuestras propias manos, pero la oportunidad de derrotar al enemigo la provee él mismo','Todos podemos cerrarnos en banda durante una batalla, pero de esta forma nunca conseguiremos la victoria.'),(25,'Mira por tus soldados como miras por un recién nacido; así estarán dispuestos a seguirte hasta los valles más profundos; cuida de tus soldados como cuidas de tus queridos hijos y morirán gustosamente contigo','El trato que le des a tus soldados será el que tú recibirás por su parte. Una de las frases de Sun Tzu más conocidas.'),(26,'Si tu enemigo se toma las cosas con tranquilidad, no le des tregua','Debemos anticiparnos a nuestro enemigo para que este no pueda prever nuestros ataques.'),(27,'Las ruedas de la justicia giran lentamente pero giran bien','La justicia más tarde o más temprano alcanza su objetivo.'),(28,'Si envías refuerzos a todas partes, serás débil en todas partes','Utilizar nuestros soldados de forma eficaz es algo que puede resultar muy difícil.'),(29,'Ganará quien sabe cuándo luchar y cuándo no luchar','Saber entablar las batallas es algo que muchos no sabemos hacer, debemos luchar solo cuando las condiciones nos sean propicias.'),(30,'Aquel que puede modificar sus tácticas en función de su oponente y así conseguir la victoria podrá ser llamado capitán nacido del cuerno del cielo','Sabernos adaptar a nuestros oponentes es una cualidad que sin duda debe poseer todo aquel gran capitán.'),(31,'Los buenos guerreros hacen que los adversarios vengan a ellos, y de ningún modo se dejan atraer fuera de su fortaleza','No debemos dejar que nuestros enemigos nos lleven a su terreno, pues de esa forma seremos derrotados con toda seguridad.'),(32,'Los colores primarios son sólo cinco, pero sus combinaciones son tan infinitas que no podemos verlas todas','Saber diferenciar a nuestros soldados en el campo de batalla es algo de vital importancia para cualquier general.'),(33,'Grandes resultados pueden ser conseguidos con pequeños esfuerzos','Incluso con los actos más pequeños podemos hacer mella en el ejército de nuestro adversario.'),(34,'El que llega primero al campo de batalla espera fresco la llegada del enemigo para combatir','Una gran cita que nos habla sobre la importancia de la puntualidad, que podemos usar en todos los aspectos de nuestra vida.'),(35,'No te sitúes río abajo','Cuando entablamos una batalla debemos aprovechar los elementos atmosféricos a nuestro favor.'),(36,'Ser violento al principio y terminar después temiendo a los propios soldados es el colmo de la ineptitud','Recibiremos el trato de nuestros soldados que nos hayamos ganado previamente.'),(37,'Recordar siempre el peligro cuando estás a salvo y el caos en tiempos de orden, permanece atento al peligro y al caos mientras no tengan todavía forma y evítalos antes de que se presenten; ésta es la mejor estrategia de todas','Debemos ser precavidos y actuar cuando las aguas están calmadas, de esta forma seremos mucho más eficaces.'),(38,'El valiente puede luchar, el cuidadoso puede hacer de centinela, y el inteligente puede estudiar, analizar y comunicar','Todos somos útiles en la guerra, pues aportamos lo mejor de nosotros para un bien común.'),(39,'Un gobierno no debe movilizar un ejército por ira y los jefes militares no deben provocar la guerra por cólera','Cuando empezamos una enemistad tiene que ser por nuestros propios pensamientos, no fruto de nuestros sentimientos momentáneos.'),(40,'Si tus fuerzas son diez veces superiores a las del adversario, rodéalo; si son cinco veces superiores, atácalo; si son dos veces superiores, divídelo','Utilizar la táctica conveniente en cada situación es algo de vital importancia para poder lograr la victoria.'),(41,'Si el enemigo está seguro en todos los puntos, prepárate para su ataque','Una buena huida a tiempo puede evitarnos males mayores, debemos saber retirarnos.'),(42,'El arte de la guerra se basa en el engaño','Si nuestro enemigo nos subestima, le habremos ganado antes de que se de cuenta.'),(43,'Si conoces al enemigo y te conoces a ti mismo, no debes temer el resultado de cientos de batallas','El conocimiento de nuestras debilidades y las debilidades de nuestro adversario, nos llevará de una forma segura hacia la victoria o la derrota.'),(44,'Si la lucha asegura la victoria, entonces debes luchar, incluso si el gobernador lo prohíbe; si la lucha no asegura la victoria, entonces no debes luchar incluso por orden del gobernante','Las grandes batallas se libran antes de que estas empiecen, pues sin una preparación correcta ya habremos perdido antes de salir al campo de batalla.'),(45,'Así, sólo un gobernante brillante o un general sabio que pueda utilizar a los más inteligentes para el espionaje, puede estar seguro de la victoria','La sabiduría es el arma más poderosa que un ser humano puede tener, pues con ella puede anticiparse a cualquier problema que pueda acontecerle.'),(46,'Estrategia sin táctica es el más lento camino hacia la victoria','Cualquier estrategia que se valga se logrará mediante las tácticas necesarias para formarla.'),(47,'Existen cinco rasgos que son peligrosos en los generales','Nuestras emociones puede ser utilizadas en nuestra contra por nuestro adversario, no debemos dejarnos llevar por ellas.'),(48,'Dale al enemigo lo que ellos esperan recibir; así serán capaces de discernir y confirmar sus suposiciones','Dar un cebo a nuestro enemigo para que este actúe de una forma determinada es una táctica que en el ajedrez se denomina gambito, ampliamente utilizada en el mundo militar.'),(49,'La victoria generalmente va al ejército que tiene oficiales y hombres mejor entrenados','Los preparativos antes de una batalla son el 90 por ciento del éxito.'),(50,'Tienes que creer en ti mismo','La confianza es totalmente necesaria, sin ella jamás lograremos vencer a un enemigo motivado.'),(51,'Los habitantes constituyen la base de un país, los alimentos son la felicidad del pueblo','Como dirigentes una gestión correcta puede llevarnos a lo más alto del éxito personal, de lo contrario podemos perder todo lo que hayamos conseguido en nuestro ascenso.'),(52,'Si haces que los adversarios no sepan el lugar y la fecha de la batalla, siempre puedes vencer','Toda falta de información en tu adversario puede ser usada en su contra.'),(53,'Hay que reflexionar y deliberar antes de tomar cualquier decisión','Reflexionar nuestros movimientos con detenimiento es algo sumamente importante, sobre todo cuando nos jugamos vidas humanas.'),(54,'En una invasión, por regla general, cuanto más se adentran los invasores en el territorio ajeno, más fuertes se hacen, hasta el punto de que el gobierno nativo no puede ya expulsarlos','La rapidez en una invasión es un factor determinante para que esta tenga éxito, como muy bien nos explica esta cita.'),(55,'No persigas a los enemigos cuando finjan una retirada, ni ataques tropas expertas','No debemos caer en las trampas que nuestro adversario nos haya preparado, esto puede ser un factor decisivo en nuestra victoria.'),(56,'Un ejército prefiere un terreno elevado y evita un terreno bajo, aprecia la luz y detesta la oscuridad','Las condiciones medioambientales en una batalla son cruciales, si las usamos a nuestro favor podremos adquirir una ventaja clara sobre nuestro adversario.'),(57,'La calidad de la decisión es como la redada a buen tiempo de un halcón, lo que le permite atacar y destruir a su víctima','Ser audaces es algo que puede sernos muy ventajoso en la batalla.'),(58,'Si no se trata bien a los espías, pueden convertirse en renegados y trabajar para el enemigo','En la guerra los espías pueden cambiar de bando en los momentos más insospechados.'),(59,'Los soldados prisioneros deben ser bien tratados, para conseguir que en el futuro luchen para ti','Sumar hombres leales a nuestras filas es vital para el crecimiento de nuestro ejército.'),(60,'La psicología de los soldados consiste en resistir cuando se ven rodeados, luchar cuando no se puede evitar y obedecer en casos extremos','Los soldados deben anteponer las órdenes militares a su propia seguridad, para que la batalla llegue a buen término.'),(61,'Donde hay grandes recompensas, hay hombres valientes','El hombre valeroso debe de ser gratamente recompensado, de esta forma siempre actuará en nuestro favor.'),(62,'Cien victorias en cien batallas no es la mayor habilidad','Saber ganar una batalla antes de que esta empiece es la cualidad de un general invencible.'),(63,'Â¿Puedes imaginar lo que haría si pudiera hacer todo lo que puedo?','Saber infundir el temor en nuestro adversario lo debilitará y le llevará a actuar de forma más predecible.'),(64,'Los que no son totalmente conscientes de las desventajas de servirse de las armas no pueden ser totalmente conscientes de las ventajas de utilizarlas','Todo tiene pros y contras, debemos saber cuándo unos son más numerosos que los otros.'),(65,'Aquél que es prudente y espera a un enemigo que no lo es, será victorioso','La anticipación es algo que nos llevará a la victoria de forma inequívoca, pues con ella nuestro enemigo no podrá reaccionar a nuestras tácticas.'),(66,'Muéstrales una manera de salvar la vida para que no estén dispuestos a luchar hasta la muerte, y así podrás aprovecharte para atacarles','Saber guiar a nuestro enemigo hacia la trampa que previamente hemos preparado, es algo muy utilizado en la batalla.'),(67,'Triunfa el que elabora una táctica para conseguirlo, aprovecha su oportunidad, acepta sus debilidades y reconoce sus fortalezas','Saber cómo entablar una batalla midiendo todos los aspectos que la conforman, es la cualidad de todo buen general.'),(68,'Nunca se debe atacar por cólera y con prisas','La preparación es de vital importancia antes de entablar cualquier combate, sin ella estamos perdidos.'),(69,'Las oportunidades se multiplican a medida que se toman','Conforme una batalla se va desarrollando las oportunidades se presentan y crecen en número.'),(70,'La defensa es para tiempos de escasez, el ataque para tiempos de abundancia','Debemos atacar cuando somos más fuertes y estamos mejor preparados.'),(71,'Deja que tus planes sean oscuros e impenetrables como la noche y cuando te muevas, cae como un rayo','El enemigo no debe saber jamás cómo y cuándo actuaremos.'),(72,'El gobernante iluminado es atento y el buen general está lleno de cautela','Esta cita nos explica las dos cualidades más importantes en un gobernante y un general, sin duda Sun Tzu sabía muy bien de lo que hablaba.'),(73,'Un líder lidera con el ejemplo, no por la fuerza','Nuestro ejemplo será la mayor bandera que podamos portar, para que otros puedan seguirnos hacia la batalla.'),(74,'Sé extremadamente misterioso, incluso hasta el punto de la ausencia de sonido','La mentira puede ser una gran baza durante la guerra, pues con ella lograremos desconcertar a nuestro oponente.'),(75,'La excelencia suprema consiste en romper la resistencia del enemigo sin luchar','Existen muchas técnicas para quebrar el ánimo de nuestro enemigo, cuando nuestro enemigo nos considera invencibles se rendirá antes de entablar batalla.'),(76,'Si tu oponente posee un temperamento colérico, procura irritarlo','Saber utilizar las emociones de nuestro enemigo en su contra nos brindará una gran oportunidad de alcanzar la victoria.'),(77,'Así es como en la guerra, el estratega victorioso solo busca la batalla después de que la victoria ya se ha ganado, mientras que aquel destinado a la derrota, primero pelea y después busca la victoria','El que sabe cómo preparar una batalla alcanzará la victoria antes siquiera de enfrentarse con su oponente.'),(78,'La ira puede convertirse en alegría, y la cólera puede convertirse en placer','Las acciones militares que llevamos a cabo pueden cambiar el mundo para siempre, pues el tiempo no puede dar marcha atrás.'),(79,'Se debe ponderar y deliberar antes de hacer un movimiento','La distracción es algo que en el campo de batalla, nos puede permitir derrotar a nuestro adversario o ser derrotados por él.'),(80,'De ahí el dicho: conoce al enemigo y conócete a ti mismo, y sobre tu victoria no caerán dudas; conoce el Cielo y la Tierra, y tu victoria estará asegurada del todo','La información es vital en todos los aspectos de una guerra, pues de ella se fundan las más grandes estrategias y tácticas.'),(81,'Para conocer a tu Enemigo debes convertirte en tu Enemigo','Conocer cómo piensa y actúa tu enemigo nos hará poder anticiparnos a sus movimientos.'),(82,'Todos los hombres pueden ver las tácticas, pero lo que nadie puede ver es la estrategia que hace que de estas observaciones evolucione la victoria','No todas las personas son capaces de prever una estrategia enrevesada en el campo de batalla.'),(83,'Los terrenos bajos son húmedos, lo cual provoca enfermedades y dificulta el combate','El tipo de terreno donde se combata puede ser crucial para el correcto funcionamiento de nuestro ejército.'),(84,'El día en que se declara la guerra, se cierran las fronteras, se rompen los salvoconductos y se impide el paso de emisarios','Cuando empieza una guerra, está afecta a todos los aspectos de la sociedad.'),(85,'La rapidez es la esencia de la guerra','La rapidez es una cualidad fundamental en cualquier gran ejército, pues con ella nuestro adversario no podrá anticiparse a nuestros movimientos.'),(86,'La prudencia y la firmeza de un pequeño número de personas pueden llegar a cansar y a dominar incluso a numerosos ejércitos','Un pequeño grupo de personas debidamente formados puede causar numerosos estragos incluso en filas mucho más numerosas.'),(87,'En asuntos militares, no es necesariamente más beneficioso ser superior en fuerzas, sólo evitar actuar con violencia innecesaria; es suficiente con consolidar tu poder, hacer estimaciones sobre el enemigo y conseguir reunir tropas; eso es todo','Cómo actuamos con nuestro ejército nos llevará o no a la victoria, incluso cuando todo parece ser favorable las tornas se pueden cambiar.'),(88,'Practica las artes marciales, calcula la fuerza de tus adversarios, haz que pierdan su ánimo y dirección, de manera que aunque el ejército enemigo esté intacto sea inservible: esto es ganar sin violencia','Meternos en la mente de nuestro adversario para que este pierda la confianza es algo que nos puede ser muy beneficioso.'),(89,'El éxito en la guerra se alcanza cuidando de adaptarse permanentemente al propósito del enemigo','La anticipación lo es todo en el arte de la guerra, prever los movimientos de nuestro adversario y utilizarlos a nuestro favor.'),(90,'Sólo cuando conoces cada detalle de la condición del terreno puedes maniobrar y luchar','El conocimiento del terreno es crucial en cualquier batalla, este nos permite ser mucho más eficaces al combatir.'),(91,'La oportunidad de asegurarnos contra la derrota está en nuestras propias manos, pero la oportunidad de derrotar al enemigo la provee él mismo','La victoria de todo buen guerrero siempre dependerá de él mismo.'),(92,'Cansa a los enemigos manteniéndolos ocupados y no dejándoles respirar','Algunas estrategias de las planteadas por Sun Tzu siguen siendo vigentes hoy en día.'),(93,'El general abarca las virtudes de sabiduría, sinceridad, humanidad, coraje y ser estricto','Un repertorio que nos enseña cómo debe ser un buen general para sus tropas.'),(94,'El desorden llega del orden, la cobardía surge del valor, la debilidad brota de la fuerza','Una de las imágenes más potentes de la filosofía de Sun Tzu.'),(95,'Si las instrucciones no son claras y las explicaciones y órdenes no son confiadas, la falta es del general','Los generales tienen la responsabilidad de dar en todo momento órdenes claras.'),(96,'La defensa es para tiempos de escasez, el ataque para tiempos de abundancia','Una de las frases más célebres de este afamado estratega.'),(97,'Luchar con otros cara a cara para conseguir ventajas es lo más arduo del mundo','La lucha cuerpo a cuerpo solo es apta para los más aguerridos soldados.'),(98,'El combatiente inteligente impone su voluntad en su enemigo, pero no permite que la voluntad de su enemigo le sea impuesta','Una frase que nos habla de la inteligencia en el campo de batalla.'),(99,'El que sabe cuándo puede volar y cuándo no, será victorioso','Creer en el propio potencial y ser conscientes de nuestra limitaciones es esencial.'),(100,'Nunca se debe atacar con cólera y con prisas','La guerra debe librarse con frialdad y con entereza, solo así triunfaremos.'),(101,'No hay ejemplo de una nación que se beneficie de la guerra prolongada','Tenemos muchos ejemplos de guerras duraderas que han sumido al país en el que se encuentran en la más absoluta miseria.'),(102,'Sé extremadamente sutil, incluso hasta el punto de lo informal','La sutileza y el engaño son algunas de las claves de un buen estratega.'),(103,'El arte de la estrategia es de importancia vital para el país','La estrategia utilizada puede decidir entre una victoria y una derrota.'),(104,'Evitar la confrontación contra formaciones de combate bien ordenadas y no atacar grandes batallones constituye el dominio de la adaptación','Una estrategia que puede ser de gran utilidad para ejércitos de todo el mundo.'),(105,'Considera a tus soldados como a tus hijos y te seguirán hasta los valles más profundos; míralos como tus propios amados hijos y estarán a tu lado incluso en la muerte','Una buena metáfora sobre cómo debe ser un buen líder para sus soldados.'),(106,'He oído hablar de operaciones militares que han sido torpes y repentinas, pero nunca he visto a ningún experto en el arte de la guerra que mantuviese la campaña por mucho tiempo','Cuánto más se alarga una campaña más probabilidades hay de fracasar.'),(107,'Pelear y conquistar en todas las batallas no es la suprema excelencia; la suprema excelencia consiste en romper la resistencia del enemigo sin luchar','Una de las grandes máximas del filósofo y estratega Sun Tzu.'),(108,'Prohíbe los augurios para evitar las dudas','Los augurios eran previsiones que se hacían habitualmente antes de un gran combate o guerra.'),(109,'Por tanto, lo que es de suprema importancia en la guerra es atacar la estrategia del enemigo','La estrategia es uno de los temas principales que aborda este estratega chino en su obra.'),(110,'No se puede obtener la verdad de los espías sin sutileza','Una frase que resume todo el horror de la guerra, especialmente en el trato a los espías.');
