  CONSTRAINT `bosquetaoista_person_casa_practica_id_8cd2c364_fk_bosquetao` FOREIGN KEY (`casa_practica_id`) REFERENCES `bosquetaoista_casa` (`id`),
  CONSTRAINT `bosquetaoista_person_estado_id_6107250e_fk_bosquetao` FOREIGN KEY (`estado_id`) REFERENCES `bosquetaoista_tipoestado` (`id`),
