coliosis\nhernia de disca lumbar\"',58,3),(61,'\"Habiendo comenzado la práctica en abril de 1991, sin una fecha fehaciente de la interrupción de la misma se estima un período de practica de año y medio.\nReinicia la práctica en noviembre de 2015\"',76,3),(62,'\"Esta graduado de Instructor\nAbandona la práctica y entrega los símbolos\nVuelve al estatus de alumno\"',84,3),(63,'docente en escuelas medias 12.',85,3),(64,'Remplazo total de cadera izquierda',90,3),(65,'\"Inició la practica en enero de 1997 en sede Ai Lin y la abandonó poco tiempo después.\nEn Abril de 2017 reinicia la práctica por severos probñemas de columnoa con 3 hernias de disco a nivel lumbar\"',92,3),(66,'Trabajo sedentario. Dolores lumbares',122,3),(67,'\"Servicio Tecnico Informatico\n10 hs. diarias\nRenuncia a la escuela por razones personales y se le acepta la renuncia por haber causado problemas internos dentro de la agrupación.\nSe recomienda la No reincorporación a la agrupación sin previo estudio del concilio de Instructores\"',165,3),(68,'\"Padece de fibromialgias - Dificultades severas para mantener la continuidad en la práctica\nDeja la practica por periódo prolongadoy retoma varias veces. La última vez retoma en febrero de 2014\"',170,3),(69,'\"Empleado, cantidad horas aprox 9 o más, hipertensión arterial, cáncer de próstata (en remisión). La fecha de Ingreso es aproximada.\nRecaida en su estado de salud aproximadamente en septiembre de 2016. No interrumpe la práctica aunque se ausenta muy seguido por razones de salud \nFallecido el 23 de marzo de 2021 (se recibió la comunicación a las 0:12, o sea que podría haber fallecido el 22 de marzo a última hora del día)\"',171,3),(70,'Trabajo en una ferreteria de 8.30 a 13.00 hs. y 15.00 a 19.30 hs y sabados de 8.30 a 14.00 y 16 a 19 hs.  soy alergico al polen  hongos. y sufro de colon irritable. ',192,3),(71,'trabajo en un frigorifico,tareas de control  en planta y de laboratorio.de 7 a 18 hs de lunes a viernas',202,3),(72,'Ama de casa, frecuente